import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import { ThemeProvider } from 'styled-components';
import { GlobalStyle, theme } from './styles/globalStyles';
import Header from './components/Header/Header';
import Footer from './components/Footer/Footer';
import HomePage from './pages/Home/HomePage';
import SearchPage from './pages/Search/SearchPage';
import RecognizePage from './pages/Recognize/RecognizePage';
import LoginPage from './pages/Auth/LoginPage';
import RegisterPage from './pages/Auth/RegisterPage';
import ProfilePage from './pages/Profile/ProfilePage';
import SongDetailPage from './pages/Songs/SongDetailPage';
import PrivateRoute from './components/PrivateRoute';
import { AuthProvider } from './context/AuthContext';
import { AudioProvider } from './context/AudioContext';

function App() {
  return (
    <ThemeProvider theme={theme}>
      <AuthProvider>
        <AudioProvider>
          <Router>
            <GlobalStyle />
            <Header />
            <main>
              <Switch>
                <Route exact path="/" component={HomePage} />
                <Route path="/search" component={SearchPage} />
                <Route path="/login" component={LoginPage} />
                <Route path="/register" component={RegisterPage} />
                <Route path="/songs/:id" component={SongDetailPage} />
                <PrivateRoute path="/recognize" component={RecognizePage} />
                <PrivateRoute path="/profile" component={ProfilePage} />
              </Switch>
            </main>
            <Footer />
          </Router>
        </AudioProvider>
      </AuthProvider>
    </ThemeProvider>
  );
}

export default App;
